n à la nature douce et même un enfant de 7 ans pourrait le contrôler. Mais il est redoutable au combat. Si ses griffes s\'ancrent dans le sol, c\'est qu\'il va tirer un puissant jet d\'eau de ses canons.\",\n\t\"Types\": [\"Eau\"],\n\t\"Resistant\": [\"Feu\", \"Eau\", \"Glace\", \"Steel\"],\n\t\"Weaknesses\": [\"Electr\", \"Plante\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Bite\",\n\t\t\"Type\": \"Dark\",\n\t\t\"Damage\": 6\n\t}, {\n\t\t\"Name\": \"Eau Gun\",\n\t\t\"Type\": \"Eau\",\n\t\t\"Damage\": 6\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Flash Cannon\",\n\t\t\"Type\": \"Steel\",\n\t\t\"Damage\": 60\n\t}, {\n\t\t\"Name\": \"Gunk Shot\",\n\t\t\"Type\": \"Poison\",\n\t\t\"Damage\": 65\n\t}, {\n\t\t\"Name\": \"Hydro Pump\",\n\t\t\"Type\": \"Eau\",\n\t\t\"Damage\": 90\n\t}, {\n\t\t\"Name\": \"Glace Beam\",\n\t\t\"Type\": \"Glace\",\n\t\t\"Damage\": 65\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"74.81kg\",\n\t\t\"Maximum\": \"96.19kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"1.4m\",\n\t\t\"Maximum\": \"1.8m\"\n\t},\n\t\"FleeRate\": 0.05,\n\t\"PreviousEvolutions\": [{\n\t\t\"Number\": 7,\n\t\t\"Name\": \"Carapuce\"\n\t}, {\n\t\t\"Number\": 8,\n\t\t\"Name\": \"Carabaffe\"\n\t}],\n\t\"MaxCP\": 2355,\n\t\"MaxHP\": 2542\n}, {\n\t\"Number\": \"010\",\n\t\"Name\": \"Chenipan\",\n\t\"Classification\": \"S\'il paraît mignon, les antennes rouges de Chenipan dégagent en revanche une odeur proche de la moisissure. Les ventouses sur ses pattes lui permettent de grimper partout. Les agriculteurs le considèrent comme nuisible, car il a un appétit d\'ogre : un seul Chenipan peut manger toutes les feuilles d\'un arbre en quelques jours.\",\n\t\"Types\": [\"Insect\"],\n\t\"Resistant\": [\"Plante\", \"Combat\", \"Sol\"],\n\t\"Weaknesses\": [\"Feu\", \"Vol\", \"Roche\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Insect Bite\",\n\t\t\"Type\": \"Insect\",\n\t\t\"Damage\": 5\n\t}, {\n\t\t\"Name\": \"Tackle\",\n\t\t\"Type\": \"Normal\",\n\t\t\"Damage\": 12\n\t}],\n\t\"SpecialAttac