ivent sur les berges des lacs, et sur les plages. Ils ne peuvent pas s\'empêcher de faire des bulles. Krabby paraît faible, mais ses pinces peuvent briser un rocher en mille morceaux. Ce Pok\\u00E8mon est incapable de se déplacer vers l\'avant : il ne sait marcher que latéralement.\",\n\t\"Types\": [\"Eau\"],\n\t\"Resistant\": [\"Feu\", \"Eau\", \"Glace\", \"Steel\"],\n\t\"Weaknesses\": [\"Electr\", \"Plante\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Bubble\",\n\t\t\"Type\": \"Eau\",\n\t\t\"Damage\": 25\n\t}, {\n\t\t\"Name\": \"Mud Shot\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 6\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Bubble Beam\",\n\t\t\"Type\": \"Eau\",\n\t\t\"Damage\": 30\n\t}, {\n\t\t\"Name\": \"VGlace Grip\",\n\t\t\"Type\": \"Normal\",\n\t\t\"Damage\": 25\n\t}, {\n\t\t\"Name\": \"Eau Pulse\",\n\t\t\"Type\": \"Eau\",\n\t\t\"Damage\": 35\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"5.69kg\",\n\t\t\"Maximum\": \"7.31kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"0.35m\",\n\t\t\"Maximum\": \"0.45m\"\n\t},\n\t\"FleeRate\": 0.15,\n\t\"NextEvolutionRequirements\": {\n\t\t\"Amount\": 50,\n\t\t\"Name\": \"Krabby candies\"\n\t},\n\t\"NextEvolutions\": [{\n\t\t\"Number\": 99,\n\t\t\"Name\": \"Krabboss\"\n\t}],\n\t\"MaxCP\": 686,\n\t\"MaxHP\": 792\n}, {\n\t\"Number\": \"099\",\n\t\"Name\": \"Krabboss\",\n\t\"Classification\": \"Si une pince de Kraboss est coupée ou arrachée, celle-ci repousse plus grosse que la précédente. De mauvais dresseurs leur ont déjà coupé la pince pour que celle-ci devienne plus puissante. S\'il attrape sa proie, celle-ci est perdue : il la brise en deux en un instant.\",\n\t\"Types\": [\"Eau\"],\n\t\"Resistant\": [\"Feu\", \"Eau\", \"Glace\", \"Steel\"],\n\t\"Weaknesses\": [\"Electr\", \"Plante\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Metal Claw\",\n\t\t\"Type\": \"Steel\",\n\t\t\"Damage\": 8\n\t}, {\n\t\t\"Name\": \"Mud Shot\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 6\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"VGlace Grip\",\n\t\t\"Type\": \"Normal\",\n\t\t\"Damage\": 25\n\t}, {\n\t\t\"Name\": \"Eau Pulse\",\n\t\t\"Type\": \"Eau\",\n\t\t\"Damage\": 35\n\t}, {\n\t\t\"Name\": \"X Scissor\",\n\t\t\"Type\": \"Insect\",\n\t\t\"Damage\": 35\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"52.5kg\",\n\t\t\"Maximum\": \"67.5kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"1.14m\",\n\t\t\"Maximum\": \"1.46m\"\n\t},\n\t\"FleeRate\": 0.07,\n\t\"PreviousEvolutions\": [{\n\t\t\"Number\": 98,\n\t\t\"Name\": \"Krabby\"\n\t}],\n\t\"MaxCP\": 1663,\n\t\"MaxHP\": 1823\n}, {\n\t\"Number\": \"100\",\n\t\"Name\": \"Voltorbe\",\n\t\"Classification\": \"La première fois qu\'on a aperçu Voltorbee, c\'était dans une usine de Pokéballs. Personne ne sait comment il est apparu sur terre. Il se déplace en roulant, en envoyant sans faire exprès quelques étincelles. Cette simili pokéball se défend grâce à des attaques Tonnerre et Grincement.\",\n\t\"Types\": [\"Electr\"],\n\t\"Resistant\": [\"Electr\", \"Vol\", \"Steel\"],\n\t\"Weaknesses\": [\"Sol\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Spark\",\n\t\t\"Type\": \"Electr\",\n\t\t\"Damage\": 7\n\t}, {\n\t\t\"Name\": \"Tackle\",\n\t\t\"Type\": \"Normal\",\n\t\t\"Damage\": 12\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Discharge\",\n\t\t\"Type\": \"Electr\",\n\t\t\"Damage\": 35\n\t}, {\n\t\t\"Name\": \"Signal Beam\",\n\t\t\"Type\": \"Insect\",\n\t\t\"Damage\": 45\n\t}, {\n\t\t\"Name\": \"Thunderbolt\",\n\t\t\"Type\": \"Electr\",\n\t\t\"Damage\": 55\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"9.1kg\",\n\t\t\"Maximum\": \"11.7kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"0.44m\",\n\t\t\"Maximum\": \"0.56m\"\n\t},\n\t\"FleeRate\": 0.1,\n\t\"NextEvolutionRequirements\": {\n\t\t\"Amount\": 50,\n\t\t\"Name\": \"Voltorbe candies\"\n\t},\n\t\"NextEvolutions\": [{\n\t\t\"Number\": 101,\n\t\t\"Name\": \"Electrode\"\n\t}],\n\t\"MaxCP\": 733,\n\t\"MaxHP\": 839\n}, {\n\t\"Number\": \"101\",\n\t\"Name\": \"Electrode\",\n\t\"Classification\": \"Electrode se nourrit exclusivement de l\'électricité qui se trouve dans notre athmosphère. Il la stocke ensuite dans son corps sous une pression incroyable : il suffit qu\'il augmente encore plus la pression de son corps pour qu\'il explose. Les jours d\'orage, il explose sans arrêt car il mange trop d\'électricité.\",\n\t\"Types\": [\"Electr\"],\n\t\"Resistant\": [\"Electr\", \"Vol\", \"Steel\"],\n\t\"Weaknesses\": [\"Sol\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Spark\",\n\t\t\"Type\": \"Electr\",\n\t\t\"Damage\": 7\n\t}, {\n\t\t\"Name\": \"Tackle\",\n\t\t\"Type\": \"Normal\",\n\t\t\"Damage\": 12\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Discharge\",\n\t\t\"Type\": \"Electr\",\n\t\t\"Damage\": 35\n\t}, {\n\t\t\"Name\": \"Hyper Beam\",\n\t\t\"Type\": \"Normal\",\n\t\t\"Damage\": 120\n\t}, {\n\t\t\"Name\": \"Thunderbolt\",\n\t\t\"Type\": \"Electr\",\n\t\t\"Damage\": 55\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"58.27kg\",\n\t\t\"Maximum\": \"74.92kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"1.05m\",\n\t\t\"Maximum\": \"1.35m\"\n\t},\n\t\"FleeRate\": 0.06,\n\t\"PreviousEvolutions\": [{\n\t\t\"Number\": 100,\n\t\t\"Name\": \"Voltorbe\"\n\t}],\n\t\"MaxCP\": 1496,\n\t\"MaxHP\": 1646\n}, {\n\t\"Number\": \"102\",\n\t\"Name\": \"Noeunoeuf\",\n\t\"Classification\": \"Un groupe de Noeunoeuf est toujours constitué de six membres solidaires, attirés entre eux comme des aimants. Si l\'un d\'entre eux se perd, ils utilisent leur énergie télépathique pour se retrouver. Comme ils n\'ont pas de jambes, il se déplacent en petits bonds organisés. La coquille fendue indique la prochaine évolution.\",\n\t\"Types\": [\"Plante\", \"Psy\"],\n\t\"Resistant\": [\"Eau\", \"Electr\", \"Plante\", \"Combat\", \"Sol\", \"Psy\"],\n\t\"Weaknesses\": [\"Feu\", \"Glace\", \"Poison\", \"Vol\", \"Insect\", \"Spectr\", \"Dark\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Confusion\",\n\t\t\"Type\": \"Psy\",\n\t\t\"Damage\": 15\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Ancient Power\",\n\t\t\"Type\": \"Roche\",\n\t\t\"Damage\": 35\n\t}, {\n\t\t\"Name\": \"Psy\",\n\t\t\"Type\": \"Psy\",\n\t\t\"Damage\": 55\n\t}, {\n\t\t\"Name\": \"Seed Bomb\",\n\t\t\"Type\": \"Plante\",\n\t\t\"Damage\": 40\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"2.19kg\",\n\t\t\"Maximum\": \"2.81kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"0.35m\",\n\t\t\"Maximum\": \"0.45m\"\n\t},\n\t\"FleeRate\": 0.1,\n\t\"NextEvolutionRequirements\": {\n\t\t\"Amount\": 50,\n\t\t\"Name\": \"E\"\n\t},\n\t\"NextEvolutions\": [{\n\t\t\"Number\": 103,\n\t\t\"Name\": \"Noadkoko\"\n\t}],\n\t\"MaxCP\": 978,\n\t\"MaxHP\": 1099\n}, {\n\t\"Number\": \"103\",\n\t\"Name\": \"Noadkoko\",\n\t\"Classification\": \"Les Noadkokos vivent dans la jungle en bande. Leurs têtes sont chacune particulière, toutes ont leur propre sentiment. Quand l\'une d\'elle tombe, elle se transforme en Noeunoeuf et part immédiatement à la recherche d\'un groupe. Ce Pok\\u00E8mon utilise sa télépathie pour communiquer.\",\n\t\"Types\": [\"Plante\", \"Psy\"],\n\t\"Resistant\": [\"Eau\", \"Electr\", \"Plante\", \"Combat\", \"Sol\", \"Psy\"],\n\t\"Weaknesses\": [\"Feu\", \"Glace\", \"Poison\", \"Vol\", \"Insect\", \"Spectr\", \"Dark\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Confusion\",\n\t\t\"Type\": \"Psy\",\n\t\t\"Damage\": 15\n\t}, {\n\t\t\"Name\": \"Zen Headbutt\",\n\t\t\"Type\": \"Psy\",\n\t\t\"Damage\": 12\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Psy\",\n\t\t\"Type\": \"Psy\",\n\t\t\"Damage\": 55\n\t}, {\n\t\t\"Name\": \"Seed Bomb\",\n\t\t\"Type\": \"Plante\",\n\t\t\"Damage\": 40\n\t}, {\n\t\t\"Name\": \"Solar Beam\",\n\t\t\"Type\": \"Plante\",\n\t\t\"Damage\": 120\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"105kg\",\n\t\t\"Maximum\": \"135kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"1.75m\",\n\t\t\"Maximum\": \"2.25m\"\n\t},\n\t\"FleeRate\": 0.06,\n\t\"PreviousEvolutions\": [{\n\t\t\"Number\": 102,\n\t\t\"Name\": \"Noeunoeuf\"\n\t}],\n\t\"MaxCP\": 2752,\n\t\"MaxHP\": 2955\n}, {\n\t\"Number\": \"104\",\n\t\"Name\": \"Osselait\",\n\t\"Classification\": \"Osselait porte toujours son casque en os sur la tête. Personne n\'a jamais vu ce Pok\\u00E8mon sans. Il fouille parmi les carcasses pour trouver un os, qu\'il utilisera comme massue. Il est très sensible, et se met à pleurer s\'il a faim, froid, soif ou peur mais quand il se bat, il peut être redoutable.\",\n\t\"Types\": [\"Sol\"],\n\t\"Resistant\": [\"Electr\", \"Poison\", \"Roche\"],\n\t\"Weaknesses\": [\"Eau\", \"Plante\", \"Glace\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Mud Slap\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 15\n\t}, {\n\t\t\"Name\": \"Roche Smash\",\n\t\t\"Type\": \"Combat\",\n\t\t\"Damage\": 15\n\t}],\n\t\"SpecialAttacks\": [{\n\t\t\"Name\": \"Bulldoze\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 35\n\t}, {\n\t\t\"Name\": \"Dig\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 70\n\t}, {\n\t\t\"Name\": \"Earthquake\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 100\n\t}],\n\t\"Weight\": {\n\t\t\"Minimum\": \"5.69kg\",\n\t\t\"Maximum\": \"7.31kg\"\n\t},\n\t\"Height\": {\n\t\t\"Minimum\": \"0.35m\",\n\t\t\"Maximum\": \"0.45m\"\n\t},\n\t\"FleeRate\": 0.1,\n\t\"NextEvolutionRequirements\": {\n\t\t\"Amount\": 50,\n\t\t\"Name\": \"Osselait candies\"\n\t},\n\t\"NextEvolutions\": [{\n\t\t\"Number\": 105,\n\t\t\"Name\": \"Ossatueur\"\n\t}],\n\t\"MaxCP\": 889,\n\t\"MaxHP\": 1006\n}, {\n\t\"Number\": \"105\",\n\t\"Name\": \"Ossatueur\",\n\t\"Classification\": \"Ossatueur sait se servir de sa massue en os d\'une manière remarquable. Jadis, ces Pok\\u00E8mons étaient faibles mais depuis qu\'ils ont appris à manier les os, ils sont devenus craints par les autres Pok\\u00E8mon. Ossatueur peut l\'utiliser pour assommer ses ennemis, mais il peut aussi lancer son os comme un boomerang.\",\n\t\"Types\": [\"Sol\"],\n\t\"Resistant\": [\"Electr\", \"Poison\", \"Roche\"],\n\t\"Weaknesses\": [\"Eau\", \"Plante\", \"Glace\"],\n\t\"FastAttacks\": [{\n\t\t\"Name\": \"Mud Slap\",\n\t\t\"Type\": \"Sol\",\n\t\t\"Damage\": 15\n\t}, {\n\t\t\"Name\": \"Roche Smash\",